import React from 'react'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faPaw } from '@fortawesome/free-solid-svg-icons'
import "../components/Home.css"

class HomePage extends React.Component{
    constructor(props){
        super(props);
    }
    render(){
        let serverimg="https://webassets.mongodb.com/_com_assets/cms/alwaysonanddurable-zzephu4plg.png"
        let isrealMap="https://upload.wikimedia.org/wikipedia/commons/thumb/a/a0/Israel_sub-districts-HE2.png/420px-Israel_sub-districts-HE2.png"
        return(
        <div>
            <div class="container">
	            <div class="row">
		            <div class="col-lg-12">
                        <div id="content">
                            <h1>PurrfectMatch </h1>
                            <h3>The Only Human-Feline Dating App</h3>
                            <hr/>
                            <button className="btn btn-light btn-lg">
                                <FontAwesomeIcon   icon={faPaw}/>
                                  get started!
                            </button>
                        </div>
	                </div>
                </div>
            </div>
        </div>
        )
    }
}
export default HomePage;
